import * as React from "react";
import logo from "../../logo.svg";
import Navbars from "../Navbar/navbarLogin";
// import { FaUserAlt, FaAddressCard } from "react-icons/fa";
import { BsArrowRightShort, BsArrowLeftShort } from "react-icons/bs";
import { FiEyeOff, FiEye, FiImage } from "react-icons/fi";
import { AiFillCheckCircle } from "react-icons/ai";
import { MdCameraAlt, MdArrowDropDown } from "react-icons/md";
import { Link } from "react-router-dom";
import { data, data5 } from "../Data/data";
import emailjs from "@emailjs/browser";

import Login1 from "../../Images/Sign_up.png";
import Signup_company from "./Signup_company"
import {
  REGI01_box1EN,
  REGI01_box1DE,
  REGI01_box1TH,
} from "../Data/DataLanguage";

import {
  IconButton,
  Radio,
  RadioGroup,
  FormControlLabel,
  FormControl,
  Input,
  Modal,
  Typography,
  Box,
  Checkbox,
  Autocomplete,
  TextField,
} from "@mui/material";

import { useNavigate, useLocation } from "react-router-dom";

const Signup = () => {
  const { innerWidth: width } = window;
  const navigate = useNavigate();
  const location = useLocation();

  let Doc = location?.state?.languages;
  console.log(Doc)

  const [file2, setFile2] = React.useState("");
  const [file3, setFile3] = React.useState("");
  const [firstname, setFirstname] = React.useState("");
  const [district, setDistrict] = React.useState("");
  const [address, setAddress] = React.useState("");
  const [province, setProvince] = React.useState("");
  const [country, setCountry] = React.useState("");
  const [email, setEmail] = React.useState("");
  const [password, setPassword] = React.useState("");
  const [confirmpassword, setConfirmpassword] = React.useState("");
  const [mobilephone, setMobilephone] = React.useState("");
  const [screen, setScreen] = React.useState("");
  const [postalcode, setPostalCode] = React.useState("");
  const [companyname, setCompanyname] = React.useState("");
  const [juristicPersonNumber, setJuristicPersonNumber] = React.useState("");
  const [website, setWebsite] = React.useState("");
  const [bankname, setBankname] = React.useState("");
  const [branchname, setBranchname] = React.useState("");
  const [accountname, setAccountname] = React.useState("");
  const [accountnumber, setAccountnumber] = React.useState("");

  const [type, setType] = React.useState("password");
  const [type2, setType2] = React.useState("password");
  const [values, setValues] = React.useState(false);
  const [values2, setValues2] = React.useState(false);
  const [open, setOpen] = React.useState(false);
  const [open2, setOpen2] = React.useState(false);

  const [open3, setOpen3] = React.useState(false);
  const [open4, setOpen4] = React.useState(false);
  const [checked, setChecked] = React.useState(false);
  const [checked2, setChecked2] = React.useState(false);

  const [images, setImages] = React.useState([]);
  const [imageURLs, setImageURLs] = React.useState([]);
  const [languages, setLanguages] = React.useState("");
  // const [answerLanguages, setAnswerLanguages] = React.useState("");
  const Form = React.useRef();

  React.useEffect(() => {
    if (images.length < 1) return;
    const newImageUrls = [];
    images.forEach((image) => newImageUrls.push(URL.createObjectURL(image)));
    setImageURLs(newImageUrls);
  }, [images]);

  function onImageChange(e) {
    setImages([...e.target.files]);
  }

  const handleOpen = () => setOpen(true);

  const handleClose = () => {
    setOpen(false);
    setChecked(false);
    setOpen2(true);
  };

  const send_Mail = (e) => {
    e.preventDefault();
    var templateParams = {
      user_email: `${email}`,
    };
    emailjs
      .send(
        "service_u5757dr",
        "template_dueh1d9",
        templateParams,
        "Npnv-PIsN0-rxduac"
      )
      .then(
        (result) => {
          console.log(result.text);
        },
        (error) => {
          console.log(error.text);
        }
      );
    // e.target.reset();
    handleClose();
    navigate("/Login");
  };

  const handleClose2 = () => setOpen2(false);
  const handleClose3 = () => setOpen3(false);

  const handleClose4 = () => {
    setOpen3(false);
    setChecked2(false);
    setOpen4(true);
  };

  const handleClose5 = () => {
    setOpen4(false);
    navigate("/Login");
  };

  const handleClickShowPassword = (i) => {
    if (i === 1) {
      if (type === "password") {
        setValues(!values);
        setType("text");
      } else if (type === "text") {
        setValues(!values);
        setType("password");
      }
    } else if (i === 2) {
      if (type2 === "password") {
        setValues2(!values2);
        setType2("text");
      } else if (type === "text") {
        setValues2(!values2);
        setType2("password");
      }
    }
  };

  const handleChange = (event) => {
    // console.log(event.target.value);
    setScreen(event.target.value);
  };

  const handleChange2 = (event) => {
    setChecked(event.target.checked);
    setChecked2(event.target.checked);
  };

  const goHome = (x) => {
    navigate("/", { state: { languages: `${x}` } });
  };

  const goLogin = (x) => {
    navigate("/Login", { state: { languages: `${x}` } });
  };
  return (
    <>
      <header
        className="App-header"
        style={{ color: "transparent", position: "absolute" }}
      >
        {Doc === undefined ? (
          <Navbars navigate={navigate} languages="English" />
        ) : Doc === "Thai" ? (
          <Navbars navigate={navigate} languages="Thai" />
        ) : Doc === "German" ? (
          <Navbars navigate={navigate} languages="German" />
        ) : (
          <Navbars navigate={navigate} languages="English" />
        )}
      </header>


        <div>
          <div
            style={{
              position: "absolute",
              width: "50%",
              height: " -webkit-fill-available",
              background: "#66C0FE",
            }}
          >
            <img
              src={Login1}
              alt="resgister"
              style={{
                width: 460,
                position: "absolute",
                top: " 10%",
                left: 100,
              }}
            />
          </div>

          <div
            style={{
              position: "absolute",
              width: "50%",
              height: "-webkit-fill-available",
              left: "50%",
              background: "#FFF3CC",
            }}
          >
            { screen === "For Translators" ? (
              <div>
          <div
            style={{
              position: "fixed",
              top: 20,
              left: width * 0.59,
              textAlign: "-webkit-center",
              width: 500,
              background: " #FFFFFF",
              boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
              borderRadius: 20,
              padding: 30,
            }}
          >
            <div
              style={{
                fontWeight: 400,
                fontSize: 18,
                textDecorationLine: "none",
                color: "#D9D9D9",
                textAlign: "left",
                marginBottom: 20,
                float: "left",
              }}
            >
              <BsArrowLeftShort />
              <Link
                to="/"
                style={{
                  color: "#D9D9D9",
                  fontSize: 18,
                  textDecorationLine: "none",
                }}
              >
                Home
              </Link>
            </div>
            <div
              style={{
                fontWeight: 400,
                textAlign: "right",
                marginBottom: 20,
                float: "right",
                color: "#D9D9D9",
              }}
            >
              <Link
                to="/Login"
                style={{
                  color: "#D9D9D9",
                  fontSize: 18,
                  textDecorationLine: "none",
                }}
              >
                Login
              </Link>
              <BsArrowRightShort />
            </div>

            <h2 className="textSignup">Sign up</h2>

            <div>
              <FormControl style={{ display: "inherit" }}>
                <RadioGroup
                  row
                  aria-labelledby="demo-row-radio-buttons-group-label"
                  name="row-radio-buttons-group"
                >
                  <FormControlLabel
                    onChange={handleChange}
                    name="radio-buttons"
                    value=""
                    control={<Radio />}
                    label="For Customers"
                    style={{ marginRight: 50 }}
                  />
                  <FormControlLabel
                    checked={true}
                    onChange={handleChange}
                    name="radio-buttons"
                    value="For Translators"
                    control={<Radio />}
                    label="For Translators"
                  />
                </RadioGroup>
              </FormControl>
            </div>

            <div style={{ textAlign: "left", marginTop: 10 }}>
              <p
                style={{
                  fontWeight: 500,
                  fontSize: 15,
                  color: "#242424",
                }}
              >
                Name
              </p>
              <input
                type="text"
                value={firstname}
                onChange={(e) => setFirstname(e.target.value)}
                placeholder="Name"
                style={{
                  background: "#FFFFFF",
                  border: "1px solid #F1F1F1 ",
                  borderRadius: 20,
                  width: "100%",
                  height: 30,
                  padding: 20,
                  paddingLeft: 12,
                  margin: 10,
                  fontSize: 13,
                }}
              />
            </div>

            <div style={{ textAlign: "left" }}>
              <p
                style={{
                  fontWeight: 500,
                  fontSize: 15,
                  color: "#242424",
                }}
              >
                E-mail
              </p>
              <input
                type="text"
                name="user_email"
                // value={email}
                onChange={(e) => setEmail(e.target.value)}
                placeholder="Example@mail.com"
                style={{
                  background: "#FFFFFF",
                  border: "1px solid #F1F1F1",
                  borderRadius: 20,
                  width: "100%",
                  height: 30,
                  padding: 20,
                  paddingLeft: 12,
                  margin: 10,
                  fontSize: 13,
                }}
              />
            </div>

            <div style={{ textAlign: "left" }}>
              <p
                style={{
                  fontWeight: 500,
                  fontSize: 15,
                  color: "#242424",
                }}
              >
                Password
              </p>

              <input
                type={type}
                value={password}
                onChange={(e) => setPassword(e.target.value)}
                placeholder="Enter your password"
                style={{
                  background: "#FFFFFF",
                  border: "1px solid #F1F1F1 ",
                  borderRadius: 20,
                  borderColor: "#F1F1F1",
                  width: "100%",
                  height: 30,
                  padding: 20,
                  paddingLeft: 12,
                  margin: 10,
                  fontSize: 13,
                }}
              />
              <IconButton
                onClick={() => handleClickShowPassword(1)}
                edge="end"
                style={{ position: "absolute", right: 40, top: 380 }}
              >
                {values ? <FiEye /> : <FiEyeOff />}
              </IconButton>
            </div>

            <div style={{ textAlign: "left" }}>
              <p
                style={{
                  fontWeight: 500,
                  fontSize: 15,
                  color: "#242424",
                }}
              >
                Confirm password
              </p>

              <input
                type={type2}
                value={confirmpassword}
                onChange={(e) => setConfirmpassword(e.target.value)}
                placeholder="Enter your password"
                style={{
                  background: "#FFFFFF",
                  border: "1px solid #F1F1F1 ",
                  borderRadius: 20,
                  borderColor: "#F1F1F1",
                  width: "100%",
                  height: 30,
                  padding: 20,
                  paddingLeft: 12,
                  margin: 10,
                  fontSize: 13,
                }}
              />
              <IconButton
                onClick={() => handleClickShowPassword(2)}
                edge="end"
                style={{ position: "absolute", right: 40, top: 465 }}
              >
                {values2 ? <FiEye /> : <FiEyeOff />}
              </IconButton>
            </div>

            <div style={{ textAlign: "left", marginBottom: 10 }}>
              <p
                style={{
                  fontWeight: 500,
                  fontSize: 15,
                  color: "#242424",
                }}
              >
                Mobile phone
              </p>

              <input
                type="text"
                value={mobilephone}
                onChange={(e) => setMobilephone(e.target.value)}
                placeholder="Mobile phone"
                style={{
                  background: "#FFFFFF",
                  border: "1px solid #F1F1F1 ",
                  borderRadius: 20,
                  borderColor: "#F1F1F1",
                  width: "100%",
                  height: 30,
                  padding: 20,
                  paddingLeft: 12,
                  margin: 10,
                  fontSize: 13,
                }}
              />
            </div>

            <button
              style={{
                width: "100%",
                borderRadius: 20,
                background: " #001E33",
                height: 40,
                color: "#FFFFFF",
                fontSize: 18,
                borderColor: "transparent",
              }}
              onClick={() => setScreen("4")}
            >
              Next
            </button>
          </div>
        </div>
            ) : screen === "3" ? (
              <>
                <div
                  style={{
                    position: "fixed",
                    top: 120,
                    left: width * 0.59,
                    textAlign: "-webkit-center",
                    width: 500,
                    background: " #FFFFFF",
                    boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                    borderRadius: 20,
                    padding: 30,
                  }}
                >
                  <button
                    style={{
                      fontWeight: 400,
                      fontSize: 18,
                      textDecorationLine: "none",
                      color: "#D9D9D9",
                      textAlign: "left",
                      marginBottom: 20,
                      float: "left",
                      background: "transparent",
                      border: "transparent",
                    }}
                    onClick={() => setScreen("")}
                  >
                    <BsArrowLeftShort />
                    <p
                      style={{
                        color: "#D9D9D9",
                        fontSize: 18,
                        textDecorationLine: "none",
                        float: "right",
                      }}
                    >
                      Back
                    </p>
                  </button>

                  <button
                    style={{
                      fontWeight: 400,
                      textAlign: "right",
                      marginBottom: 20,
                      float: "right",
                      color: "#D9D9D9",
                      background: "transparent",
                      border: "transparent",
                    }}
                    onClick={() => setScreen("5")}
                  >
                    <p
                      style={{
                        color: "#D9D9D9",
                        fontSize: 18,
                        textDecorationLine: "none",
                        float: "left",
                      }}
                    >
                      Skip
                    </p>
                    <BsArrowRightShort />
                  </button>

                  <h2 className="textSignup">Sign up</h2>
                  <div style={{ margin: 25 }}>
                    <p>Upload Image</p>
                  </div>
                  {images.length < 1 ? (
                    <div
                      style={{
                        background: "#FFFFFF",
                        borderRadius: 100,
                        width: 83,
                        height: 80,
                        padding: 15,
                        position: "relative",
                        borderStyle: " dotted ",
                        borderColor: "#0865A8",
                        borderWidth: 2,
                        margin: 25,
                      }}
                    >
                      <label htmlFor="icon-button-file">
                        <Input
                          accept="image/*"
                          id="icon-button-file"
                          type="file"
                          style={{ display: "none" }}
                          onChange={onImageChange}
                        />
                        <IconButton
                          color="primary"
                          aria-label="upload picture"
                          component="span"
                        >
                          <MdCameraAlt
                            style={{ fontSize: 35, position: "absolute" }}
                          />
                          <p
                            style={{
                              fontSize: 8,
                              position: "absolute",
                              top: 20,
                              width: 63,
                            }}
                          >
                            Upload File
                          </p>
                        </IconButton>
                      </label>
                    </div>
                  ) : (
                    <div
                      style={{
                        borderRadius: 100,
                        width: 100,
                        height: 100,
                        position: "relative",
                        borderWidth: 2,
                        margin: 25,
                      }}
                    >
                      <label htmlFor="icon-button-file">
                        <Input
                          accept="image/*"
                          id="icon-button-file"
                          type="file"
                          style={{ display: "none" }}
                          onChange={onImageChange}
                        />
                        <IconButton
                          color="primary"
                          aria-label="upload picture"
                          component="span"
                        >
                          {imageURLs.map((imageSrc, idx) => (
                            <img
                              key={idx}
                              src={imageSrc}
                              alt="imageURLs"
                              style={{
                                position: "absolute",
                                width: 90,
                                height: 90,
                                borderRadius: "100%",
                                top: -20,
                              }}
                            />
                          ))}
                        </IconButton>
                      </label>
                    </div>
                  )}

                  <button
                    style={{
                      width: "100%",
                      borderRadius: 20,
                      background: " #001E33",
                      height: 40,
                      color: "#FFFFFF",
                      fontSize: 18,
                      borderColor: "transparent",
                      marginBottom: 10,
                    }}
                    onClick={() => setScreen("5")}
                  >
                    Next
                  </button>
                </div>
              </>
            ) : screen === "4" ? (
              <>
                <div
                  style={{
                    position: "fixed",
                    top: 120,
                    left: width * 0.59,
                    textAlign: "-webkit-center",
                    width: 500,
                    background: " #FFFFFF",
                    boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                    borderRadius: 20,
                    padding: 30,
                  }}
                >
                  <button
                    style={{
                      fontWeight: 400,
                      fontSize: 18,
                      textDecorationLine: "none",
                      color: "#D9D9D9",
                      textAlign: "left",
                      marginBottom: 20,
                      float: "left",
                      background: "transparent",
                      border: "transparent",
                    }}
                    onClick={() => setScreen("For Translators")}
                  >
                    <BsArrowLeftShort />
                    <p
                      to="/"
                      style={{
                        color: "#D9D9D9",
                        fontSize: 18,
                        textDecorationLine: "none",
                        float: "right",
                      }}
                    >
                      Back
                    </p>
                  </button>

                  <button
                    style={{
                      fontWeight: 400,
                      textAlign: "right",
                      marginBottom: 20,
                      float: "right",
                      color: "#D9D9D9",
                      background: "transparent",
                      border: "transparent",
                    }}
                    onClick={() => setScreen("6")}
                  >
                    <p
                      style={{
                        color: "#D9D9D9",
                        fontSize: 18,
                        textDecorationLine: "none",
                        float: "left",
                      }}
                    >
                      Skip
                    </p>
                    <BsArrowRightShort />
                  </button>

                  <h2 className="textSignup">Sign up</h2>
                  <div style={{ margin: 25 }}>
                    <p>Upload Image</p>
                  </div>
                  {images.length < 1 ? (
                    <div
                      style={{
                        background: "#FFFFFF",
                        borderRadius: 100,
                        width: 83,
                        height: 80,
                        padding: 15,
                        position: "relative",
                        borderStyle: " dotted ",
                        borderColor: "#0865A8",
                        borderWidth: 2,
                        margin: 25,
                      }}
                    >
                      <label htmlFor="icon-button-file">
                        <Input
                          accept="image/*"
                          id="icon-button-file"
                          type="file"
                          style={{ display: "none" }}
                          onChange={onImageChange}
                        />
