                          color="primary"
                          aria-label="upload picture"
                          component="span"
                        >
                          <MdCameraAlt
                            style={{ fontSize: 35, position: "absolute" }}
                          />
                          <p
                            style={{
                              fontSize: 8,
                              position: "absolute",
                              top: 20,
                              width: 63,
                            }}
                          >
                            Upload File
                          </p>
                        </IconButton>
                      </label>
                    </div>
                  ) : (
                    <div
                      style={{
                        borderRadius: 100,
                        width: 100,
                        height: 100,
                        position: "relative",
                        borderWidth: 2,
                        margin: 25,
                      }}
                    >
                      <label htmlFor="icon-button-file">
                        <Input
                          accept="image/*"
                          id="icon-button-file"
                          type="file"
                          style={{ display: "none" }}
                          onChange={onImageChange}
                        />
                        <IconButton
                          color="primary"
                          aria-label="upload picture"
                          component="span"
                        >
                          {imageURLs.map((imageSrc, idx) => (
                            <img
                              key={idx}
                              src={imageSrc}
                              alt="imageURLs"
                              style={{
                                position: "absolute",
                                width: 90,
                                height: 90,
                                borderRadius: "100%",
                                top: -20,
                              }}
                            />
                          ))}
                        </IconButton>
                      </label>
                    </div>
                  )}

                  <button
                    style={{
                      width: "100%",
                      borderRadius: 20,
                      background: " #001E33",
                      height: 40,
                      color: "#FFFFFF",
                      fontSize: 18,
                      borderColor: "transparent",
                      marginBottom: 10,
                    }}
                    onClick={() => setScreen("6")}
                  >
                    Next
                  </button>
                </div>
              </>
            ) : screen === "5" ? (
              <div>
                <div
                  style={{
                    position: "fixed",
                    top: 20,
                    left: width * 0.59,
                    textAlign: "-webkit-center",
                    width: 500,
                    background: " #FFFFFF",
                    boxShadow: " 0px 4px 25px rgba(0, 0, 0, 0.15)",
                    borderRadius: 20,
                    padding: 30,
                  }}
                >
                  <button
                    style={{
                      fontWeight: 400,
                      fontSize: 18,
                      textDecorationLine: "none",
                      color: "#D9D9D9",
                      textAlign: "left",
                      marginBottom: 20,
                      float: "left",
                      background: "transparent",
                      border: "transparent",
                    }}
                    onClick={() => setScreen("3")}
                  >
                    <BsArrowLeftShort />
                    <p
                      style={{
                        color: "#D9D9D9",
                        fontSize: 18,
                        textDecorationLine: "none",
                        float: "right",
                      }}
                    >
                      Back
                    </p>
                  </button>

                  <h2 className="textSignup">Sign up</h2>

                  <div style={{ textAlign: "left", marginTop: 10 }}>
                    <p
                      style={{
                        fontWeight: 500,
                        fontSize: 15,
                        color: "#242424",
                      }}
                    >
                      Address
                    </p>
                    <input
